INSERT INTO `asunto` (`id`, `descripcion_cabecera`, `estado`, `padre_id`, `descripcion_larga`, `descripcion_corta`) VALUES
(1, '¡Somos diferentes, somos adolescentes!', 1, 1, 'Existen ciertos prejuicios sobre cómo somos las y los adolescentes. A veces dejan de lado nuestras propuestas porque dicen que somos rebeldes, flojos o que somos inmaduros. Nos ponen a todos en el mismo saco, pero cada uno de nosotros piensa distinto y nos gustan cosas diferentes. Demostremos que podemos generar cambios sin perder nuestro estilo. ¿Qué significa hacer arte en la calle? ¿Qué nos une a los jóvenes de un barrio o comunidad? ¿Cómo podemos cambiar nuestro entorno mediante la música y el deporte?, etc.', 'Estereotipos sobre los adolescentes'),
(2, '¡Hablemos de género!', 1, 1, 'En nuestro entorno, diariamente, podemos escuchar mensajes como “los hombres no lloran” o “las mujeres son el sexo débil”. Estos mensajes responden a estereotipos que se asignan a las personas por su género (masculino o femenino), cuando en realidad mujeres y varones podemos realizar las mismas actividades, tener los mismos sueños y proyectos. ¡Recuerda que ambos tenemos los mismos derechos!\nEl sexo con el que nacimos no debería definir nuestro futuro, ni las metas que podemos alcanzar. No olvidemos cuán diversos somos y que debemos asumir una actitud crítica frente a la discriminación por género. Un paso importante para luchar contra la desigualdad es dialogar sobre ello. ¡Somos parte del cambio!', 'Discriminación por género'),
(3, 'Nuestra cultura está viva. ¡Nosotros la vivimos!', 1, 1, 'En nuestro país coexisten diversas culturas. Sin embargo, no siempre respetamos las creencias y costumbres de los demás. A veces discriminamos o somos discriminados por nuestro idioma, nuestra forma de vestir y hasta por nuestras creencias. Aprovechemos para dialogar entre culturas, aprendamos unos de otros sin ver por encima del hombro. Podemos tocar este asunto público promoviendo el diálogo y el respeto entre culturas.', 'Discriminación por etnia'),
(4, '¡El dinero no nos define!', 1, 1, 'El lugar en el que vivimos o los ingresos de nuestra familia no definen quiénes somos ni, mucho menos, quiénes podemos llegar a ser. No hay profesiones u oficios que merezcan más respeto que otras. Aprendamos que solo podremos construir un mejor país si trabajamos todos juntos. Hágamos que los demás también tomen conciencia de esta necesidad.', 'Discriminación por condición social'),
(5, '¡Las dificultades no son impedimentos!', 1, 1, 'A veces dejamos de lado a quienes tienen algún tipo de discapacidad pensando que no pueden hacer o lograr ciertas cosas. En algunas ocasiones se dice que es para protegerlos, en otras es solo por ignorancia. Pero, ¿quién determina qué es lo que podemos lograr? ¿No debería ser uno mismo? Hagamos visible esta situación, valoremos las habilidades diferentes, propongamos formas de integrar a las personas con discapacidad, ayudemos a que cada uno pueda definir sus metas.', 'Discriminación por habilidades diferentes'),
(6, '¡Tenemos derecho a ser mejores!', 1, 1, 'Al pasar por situaciones difíciles o al andar con malas compañías, a veces terminamos rompiendo la ley. Después nos sentimos acorralados, como si no hubiera salida, y algunos nos dan la espalda. Pero las cosas siempre pueden cambiar para bien. Solo necesitamos decidirlo y contar con el apoyo de quienes nos rodean. Encontremos la manera de asumir nuestras acciones con responsabilidad. ¿Qué podemos hacer para reparar el daño que causamos? ¿Cómo ayudar a que otros no cometan el mismo error? Hablemos del tema, promovamos ese cambio y encontremos salidas creativas a esas situaciones.', 'Adolescentes en conflicto con la ley penal'),
(7, 'No necesito un vicio', 1, 1, '¿Necesitamos de un videojuego o una sustancia para divertirnos? Definitivamente no. Las adicciones nos hacen daño, nos alejan de nuestras metas y de quienes realmente nos quieren. Cuando buscamos “salidas” en lugares equivocados, los malos amigos siempre nos dirán que “no pasa nada” pero, ¡es mentira! Construyamos espacios para divertirnos y relajarnos sanamente, conozcamos cómo nos afectan las adicciones así como las formas de superarlas ¡Siempre hay una mejor salida!', 'Problemas de adicción'),
(8, '¿Trabajar o no trabajar?', 1, 1, '¿Cuándo y por qué razones podemos comenzar a trabajar? ¿Cuál es la diferencia entre apoyar en casa y tener un empleo? ¿Alguien puede obligarnos a trabajar? Si trabajamos ¿debemos dejar los estudios? Sabemos que a veces necesitamos apoyar económicamente a nuestra familia, conversemos sobre esta realidad y presentemos nuestras perspectivas y la situación del trabajo adolescente en nuestro entorno.', 'Trabajo adolescente: riesgos y beneficios'),
(9, '¡Terminé el cole!... ¿Y ahora?', 1, 1, '¿Qué es lo que nos espera después de terminar secundaria? ¿Acaso las mejores oportunidades están ahí esperándonos o deberemos trazarnos metas y luchar por ellas? ¿Todos tendremos las mismas oportunidades? Sabemos que por lo general nos esperan dos cosas: trabajo o estudio; pero, ¿qué significa cada uno de estos destinos? Generemos espacios para conversar sobre el tema, identifiquemos oportunidades, evaluémoslas y difundamos las más chéveres entre nuestros compañeros.', 'Oportunidades de estudio y de trabajo'),
(10, 'Hablemos de sexo: dilo sin roche', 1, 1, 'Hace tiempo que hablamos de nuestras relaciones. Pero ¿manejaremos la información adecuada? A algunos nos da roche hablar de esto públicamente y a los adultos también. Tenemos muchas preguntas y a veces pocas respuestas. ¿Sabías que el disfrute de la sexualidad no son solo las relaciones sexuales (coito)? ¿Cómo podemos llevar sanamente una relación de pareja? ¿Cómo disfruto mi sexualidad? Si es que decido iniciar una vida sexual responsable, ¿qué riesgos o responsabilidades debo asumir? Búsquenos información especializada y encontremos maneras creativas para difundirla y conversar de estos temas sin roche.', 'Sexualidad en adolescentes'),
(11, 'Ser mamá o papá estando en el cole', 1, 1, 'Dicen que no debería suceder, pero sucede. A veces, las y los adolescentes nos convertimos en padres y madres a pesar de los riesgos. Repentinamente todos hablan de lo que “hubiéramos hecho” ¿No será mejor hablar de lo que “podemos hacer”? Es momento de asumir responsabilidades y buscar oportunidades. Acompañemos a quienes atraviesan esta situación, busquemos orientación y conversemos sobre lo que implica ser madres o padres adolescentes: los peligros, las responsabilidades, las emociones, cómo nos podrían apoyar en esta situación, etc.', 'La responsabilidad de ser madres y padres en la adolescencia'),
(12, 'Nativos digitales', 1, 1, 'A diferencia de los adultos, los adolescentes comprendemos mejor la Internet y las diversas herramientas tecnológicas. Navegar en la web y conectarnos a las redes sociales es algo cotidiano. Pero también hay personas malintencionadas en el mundo virtual y estamos expuestos a ciertos peligros. Conozcamos los riesgos y oportunidades del mundo digital y promovamos un uso responsable de la tecnología.', 'El uso de la tecnología, la Internet y las redes sociales'),
(13, 'La violencia es para los débiles', 1, 2, 'La violencia nunca es la respuesta correcta. No generá respeto ni disciplina, solo ocasiona miedo y resentimiento. Sin embargo, aún hay personas que se ponen violentas: levantan la voz, dicen cosas hirientes, incluso llegan a los golpes. También hay compañeros a quienes “agarran de punto” y agreden constantemente. Si no enfrentamos el problema, las cosas acabarán peor. Encontremos la manera de parar la violencia en el cole; para hacerlo es necesario que se involucre toda la comunidad educativa.', 'Violencia escolar'),
(14, '¡Participa, actúa y cambia tu escuela!', 1, 2, '¿Para qué me sirve aprender esto? Seguro nos hemos repetido esa frase muchas veces. Pero, ¿cuántas veces hemos presentado propuestas sobre qué o cómo queremos aprender?, ¿toman en cuenta nuestras opiniones e iniciativas?, ¿cómo podemos aportar como estudiantes? Podemos organizarnos para proponer mejoras en el cole: qué sería interesante ver en las áreas, qué actividades extracurriculares podríamos desarrollar, cómo podemos mejorar nuestras aulas o qué podemos hacer para integrarnos entre estudiantes.', 'Participación y organización estudiantil en la escuela'),
(15, '¡Participa, actúa y juégatela por tu comunidad!', 1, 2, 'Los estudiantes y profesores no somos los únicos en la comunidad educativa. También están los padres, el director, el personal de la institución y otras instituciones de la comunidad ¿Cómo podemos trabajar juntos para mejorar nuestra institución? Propongamos maneras creativas para generar cambios que nos unan como comunidad.', 'Participación de los actores de la comunidad educativa'),
(16, 'Diálogo, acuerdos y compromisos', 1, 2, 'Para que las cosas marchen bien en nuestra escuela, tenemos que dialogar y establecer ciertas normas y acuerdos, y comprometernos a cumplirlos. ¿Sabías que los estudiantes podemos definir las Normas de Concivencia de la institución? ¿Alguna vez te han consultado para definirlas? Construyámoslas democráticamente porque de otro modo no los sentiremos nuestros y no nos comprometeremos con ellos. Generemos espacios para dialogar y llegar a consensos.', 'Construcción de normas y acuerdos en la escuela'),
(17, 'Con-VIVE y haz tuya la escuela', 1, 2, '¿Cuántas horas del año pasamos en el colegio? Sí que termina siendo nuestra segunda casa. Pero, ¿cómo son las relaciones en el cole?, ¿existen conflictos?, ¿cómo los resolvemos? Planteemos cómo podemos mejorar la convivencia para mejorar a partir de los conflictos y así sentirnos en casa. Creemos espacios para dialogar, aprender y divertirnos. ¡Hagamos que todos quieran ir al cole!', 'Convivencia en la escuela'),
(18, 'Queremos cambios. ¡Creamos soluciones!', 1, 2, '¿El colegio puede aportar a la comunidad? ¡Claro que sí y mucho! Imaginen si todos los compañeros limpiáramos nuestro vecindario o si ayudáramos en la posta o en los cultivos. Somos parte de la comunidad y podemos hacer grandes cambios. Identifiquemos en qué podemos ayudar, organicémonos y encontremos una manera creativa de hacerlo.', 'Posibilidades de aporte a la comunidad'),
(19, 'Aprendizajes para la vida', 1, 2, 'En clase nos presentan diferentes situaciones a partir de las que aprendemos. Pero, ¿serán realmente significativas para nosotros? ¿Alguna vez nos han preguntado qué nos interesa aprender? Si nos organizamos y fundamentamos nuestros intereses, seguro los tomarán en cuenta. Coordinemos con los profes y presentemos nuestras propuestas ¡Seguro que todos nos llevaremos una grata sorpresa!', 'Necesidades educativas de los estudiantes'),
(20, 'Con secundaria completa sí la hacemos', 1, 2, 'Para algunos de nosotros terminar la secundaria no es algo fácil. Se nos presentan retos personales o familiares que nos la ponen difícil. Además, muchas veces nos preguntamos ¿para qué nos servirá terminar el cole? ¿Qué será de los compañeros que se fueron? ¿Cómo evitar que otros se vayan? Busquemos respuestas a estas preguntas y, sobre todo, identifiquemos todos los beneficios de terminar la secundaria. Involucremos a la comunidad educativa, la deserción nos afecta a todos.', 'Deserción escolar'),
(21, '¡Nuestros derechos se respetan!', 1, 3, 'Los niños, niñas y adolescentes tenemos un conjunto de derechos que nadie puede vulnerar, o al menos eso es lo que dice la ley. Pero la realidad es otra y, muchas veces la sociedad se olvida nuestros derechos. Evitemos que esto siga pasando. Reconozcamos y difundamos nuestros derechos. Luchemos para asegurarnos de que sean respetados.', 'Derechos de niños, niñas y adolescentes'),
(22, '¡Yo decido! Mi cuerpo: mis derechos', 1, 3, 'Nuestro cuerpo es solo nuestro y nadie puede decidir sobre él. Existen derechos que protegen nuestro cuerpo y como debemos practicar nuestra sexualidad. Lamentablemente, existen personas que no respetan estos derechos, vulnerándolos y violentando nuestra integridad física y sexual. Por eso debemos de protegernos e informarnos de cómo evitar que estas situaciones se sigan dando en nuestro país.', 'Derechos sexuales y reproductivos'),
(23, '¡Mejoramos nuestra comunidad, mejoramos nuestra vida!', 1, 3, 'La calidad de vida depende de las condiciones en las que vivimos. Nuestra salud, alimentación y bienestar, así como la posibilidad de ejercer nuestros derechos reflejan esas condiciones. ¿Cómo podemos mejorar nuestra calidad de vida? Juntos podemos mejorar las condiciones en nuestra comunidad.', 'Calidad de vida'),
(24, 'Tumbemos la corrupción', 1, 3, 'Pareciera que la gente ya se ha acostumbrado a la corrupción ¡Pero nosotros NO! Hay corrupción cuando se da una coima, cuando se infla un presupuesto, cuando un funcionario se queda con dinero que no le pertenece. ¿Hay corrupción en tu cole? ¿Y en tú comunidad? Analicemos los actos de corrupción más frecuentes y propongamos soluciones. ¡Si no acabamos con la corrupción, la corrupción acabará con nosotros!', 'La problemática de la corrupción'),
(25, 'Sismos, huaicos, heladas, inundaciones… ¿Estamos preparados?', 1, 3, 'En nuestro país ocurren constantemente diversos fenómenos naturales (sismos, inundaciones, heladas, huaicos, etc.) y si no estamos preparados pueden generar muchas pérdidas humanas y materiales. Además, el fenómeno del Niño agrava esta situación ¿Existirán maneras de disminuir los riesgos a los que nos enfrentamos? Conozcamos las características geográficas de nuestra comunidad, identifiquemos los peligros a los que está expuesta y organicémonos para estar preparados.', 'Gestión del riesgo de desastres'),
(26, '¡Cuidemos el presente para tener un futuro!', 1, 3, 'Nuestro planeta no durará para siempre y mucho menos si seguimos dañándolo como lo hacemos. ¿Cuántos árboles y animales encontrarán nuestros hijos y nietos? ¿Cómo será el clima en esos días? Debemos encontrar la manera de que nuestras acciones no dañen el medio ambiente. ¿Existirán actividades productivas que cuiden el ecosistema? Utilicemos responsablemente los recursos naturales y encontremos maneras creativas de reducir, reutilizar y reciclar. Propongamos soluciones locales a problemas globales. ¡Cada día más que no actuemos es un día menos para nosotros y el de la madre Tierra!', 'Desarrollo sostenible'),
(27, '¡Las personas no tenemos precio!', 1, 3, 'Las personas no somos objetos a los que se puede comprar, vender o usar. Sin embargo, hay personas malintencionadas que comercian con otras personas. A nadie le dicen que lo van a vender o explotar. Podemos estar expuestos a engaños y falsas promesas, y si no conocemos nuestros derechos es más fácil que nos convirtamos en víctimas. Conozcamos más sobre esta situación y contribuyamos a ponerle fin.', 'La trata de personas'),
(28, 'Nuestra riqueza: la diversidad', 1, 3, 'En el Perú se dice que todos somos una mezcla de culturas. Cuando aprendemos de los demás y ellos de nosotros, todos crecemos. Nuestra música y comida lo demuestran. Creemos expresiones, experiencias y espacios donde se muestren el encuentro, intercambio e interacción de diversas culturas. Difundamos diversos ejemplos de diálogo intercultural y sus beneficios para nuestra sociedad.', 'Desafíos de la convivencia intercultural'),
(29, 'Seguros en las vías', 1, 3, '¿Cuántos accidentes de tránsito ocurren diariamente? ¿Podemos disminuir ese número? ¿Qué necesitamos para hacerlo? Hay conductores que no respetan las reglas de tránsito pero no son los únicos. Muchos peatones tampoco lo hacen y al final todos nos encontramos en peligro. Pensemos en maneras creativas para difundir y promover el respeto de las reglas de tránsito. Juntos podemos lograr que hayan menos accidentes.', 'Educación en seguridad vial'),
(30, 'Sin violencia, ¡qué bien se siente!', 1, 3, 'Nuestros hogares deberían ser espacios de tranquilidad y amor, pero muchas veces la violencia no deja que eso ocurra. En ocasiones, presenciamos o somos víctimas de situaciones de violencia que nos marcan. Lamentablemente, hay personas que justifican el uso de la violencia debido a la forma en que fueron criadas. Hoy en día ¡NADIE puede ser agredido física, verbal ni psicológicamente! Encontremos formas de reducir la violencia en nuestra comunidad. Conozcamos qué hacer si sufrimos esta situación y cómo podemos superarla.', 'Violencia familiar'),
(31, 'Oportunidades descentralizadas', 1, 3, 'Durante siglos el Perú ha girado en torno a Lima. Si se necesitaba ir a la universidad o a un buen hospital había que ir a Lima o a la capital de nuestra región. Eso sí que era centralismo. Las cosas han mejorado pero aún hay muchas tareas pendientes para lograr la descentralización. ¿Un adolescente de provincia tiene las mismas facilidades que uno de la capital? ¿Qué retos aún debemos superar para que todos podamos acceder a las mismas oportunidades? ¿Qué deberían hacer los gobiernos regionales y locales? ¿Tenemos propuestas frente a esos retos? Identifiquémoslas y dinfundámoslas.', 'Centralismo y descentralización'),
(32, 'Camina seguro, ¡camina sin miedo!', 1, 3, 'Todos deberíamos poder salir a pasear sin pensar que nos robarán o harán daño. Pero, en la actualidad nadie sabe lo que nos espera en la calle. Si nos organizamos adecuadamente podemos hacer que nuestra escuela y comunidad sea segura. Podríamos proponer sistemas de seguridad comunal o acciones para prevenir la delincuencia. Para lograrlo necesitamos coordinar con las autoridades y asumir compromisos.', 'Seguridad ciudadana');
